// MinigoLexerInit initializes any static state used to implement MinigoLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewMinigoLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func MinigoLexerInit() {
	staticData := &MinigoLexerLexerStaticData
	staticData.once.Do(minigolexerLexerInit)
}

// NewMinigoLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewMinigoLexer(input antlr.CharStream) *MinigoLexer {
	MinigoLexerInit()
	l := new(MinigoLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &MinigoLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "Minigo.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

